	@param var viewport:Vec4;
	var output:{ var position : Vec4; var colorID : Vec4};
	function vertex() {
		output.position = (output.position + vec4(viewport.xy, 0., 0.) * output.position.w) * vec4(viewport.zw, 1., 1.);
	};
	function fragment() {
		output.colorID = colorID;
	};
