Returns a new Vector that consists of a range of elements from the original Vector, without modifying the original Vector. The returned Vector includes the `startIndex` element and all elements up to, but not including, the `endIndex` element.
If you don't pass any parameters, the new Vector is a duplicate (shallow clone) of the original Vector. If you pass a value of 0 for both parameters, a new, empty Vector is created of the same type as the original Vector.
@param startIndex A number specifying the index of the starting point for the slice. If startIndex is a negative number, the starting point begins at the end of the Vector, where -1 is the last element. @param endIndex A number specifying the index of the ending point for the slice. If you omit this parameter, the slice includes all elements from the starting point to the end of the Vector. If endIndex is a negative number, the ending point is specified from the end of the Vector, where -1 is the last element. @return A Vector that consists of a range of elements from the original Vector.

splice.haxe_doc:
Adds elements to and removes elements from the Vector. This method modifies the
		Vector without making a copy.

		**Note:** To override this method in a subclass of Vector, use ...args for the
		parameters, as this example shows:

		```as3
		public override function splice(...args) {
		// your statements here
		}
		```

		@param	startIndex:int â€” An integer that specifies the index of the element in the Vector where the insertion or deletion begins. You can use a negative integer to specify a position relative to the end of the Vector (for example, -1 for the last element of the Vector).
		@param	deleteCount:uint (default = 4294967295) â€” An integer that specifies the number of elements to be deleted. This number includes the element specified in the startIndex parameter. If the value is 0, no elements are deleted.
		@param	... items â€” An optional list of one or more comma-separated values to insert into the Vector at the position specified in the startIndex parameter.
		@return	a Vector containing the elements that were removed from the original Vector.
		@throws	RangeError	If the startIndex and deleteCount arguments specify an index to be deleted that's outside the Vector's bounds.
		@throws	RangeError	If this method is called while fixed is true and the splice() operation changes the length of the Vector.

unshift.haxe_doc:
Adds one or more elements to the beginning of the Vector and returns the new
		length of the Vector. The other elements in the Vector are moved from their
		original position, i, to i + the number of new elements.

		Because this function can accept multiple arguments, the data type of the
		arguments is not checked at compile time even in strict mode. However, if an
		argument is passed that is not an instance of the base type, an exception occurs
		at run time.

		@param	value	An instance of the base type of the Vector to be inserted at the
		beginning of the Vector.
		@return	An integer representing the new length of the Vector.
		@throws	TypeError	If any argument is not an instance of the base type T of the
		Vector.
		@throws	RangeError	If this method is called while fixed is true.

